import "./App.js";

function Banner() {
  return (
    <div className="Banner">
      <div>
        <h3>Emmanuel Ma</h3>
      </div>
      <div>
        <a href="#" class="active">
          Home
        </a>
        <a href="#">News</a>
        <a href="#">Contact</a>
        <a href="#">About</a>
      </div>
    </div>
  );
}

export default Banner;
